import { Component } from '@angular/core';
// import { RouterOutlet } from '@angular/router';
import { CommonModule } from '@angular/common';
import * as XLSX from 'xlsx';
import jsPDF from 'jspdf';
import autoTable from 'jspdf-autotable';
import { HttpClient } from '@angular/common/http';

@Component({
  selector: 'app-report',
  standalone: true,
  imports: [CommonModule],
  templateUrl: './report.component.html',
  styleUrl: './report.component.css'
})
export class ReportComponent {
  constructor(private http: HttpClient) { }
  title = 'UCL_WEEKEND_REPORT';
  public weekend: any = [];
  public monday: any = [];
  finalMergedData: any = [];
  public isLoading: any = false;

  onFileChange(event: any): void {
    const file = event.target.files[0];
    if (!file) return;

    const reader = new FileReader();

    reader.onload = (e: any) => {
      const data = new Uint8Array(e.target.result);
      const workbook = XLSX.read(data, { type: 'array' });

      const sheetName = workbook.SheetNames[0];
      const worksheet = workbook.Sheets[sheetName];

      const jsonData = XLSX.utils.sheet_to_json(worksheet, { defval: '' });
      // console.log("before removing duplicates", jsonData)
      const unique = new Set<string>();
      const filteredData = jsonData.filter((row: any) => {
        const key = `${row['Building / Room']}::${row['Title/Meeting Name']}`;
        if (unique.has(key)) return false;
        unique.add(key);
        return true;
      });
      this.weekend = filteredData;
      // console.log('Filtered Unique Data:', this.weekend);
    };

    reader.readAsArrayBuffer(file);
  }


  onFileChange1(event: any): void {

    // console.log("comes here");
    this.monday = [];
    const file = event.target.files[0];
    if (!file) return;

    const reader = new FileReader();

    reader.onload = (e: any) => {
      const data = new Uint8Array(e.target.result);
      const workbook = XLSX.read(data, { type: 'array' });

      const sheetName = workbook.SheetNames[0];
      const worksheet = workbook.Sheets[sheetName];

      const jsonData = XLSX.utils.sheet_to_json(worksheet, { defval: '' });
      // console.log("before filter", jsonData);
      const map = new Map<string, any>();

      jsonData.forEach((row: any) => {
        const building = row['Building / Room'];
        const title = row['Title/Meeting Name'];
        const timeRange = row['__EMPTY'];

        if (!building || !title || !timeRange) return;

        const key = `${building}::${title}`;
        const startTime = this.parseTime(timeRange.split('-')[0]);

        if (!map.has(key) || startTime < map.get(key).startTime) {
          map.set(key, { ...row, startTime });
        }
      });

      const filteredData = Array.from(map.values()).map(({ startTime, ...rest }) => rest);
      this.monday = filteredData
      // console.log('Filtered by earliest time:', this.monday);
    };

    reader.readAsArrayBuffer(file);

  }

  parseTime(timeStr: string): number {
    const trimmed = timeStr.trim();
    const [time, modifier] = trimmed.split(/(AM|PM)/i);
    let [hours, minutes] = time.split(':').map(Number);

    if (modifier.toUpperCase() === 'PM' && hours !== 12) hours += 12;
    if (modifier.toUpperCase() === 'AM' && hours === 12) hours = 0;

    return hours * 60 + minutes;
  }

  onSubmit() {
    if (this.weekend.length === 0 || !this.weekend) {
      alert("There is something wrong! Upload weekend report again");
    } else if (this.monday.length === 0 || !this.monday) {
      alert("There is something wrong! Upload monday report again");
    } else {
      this.isLoading = true;
      const finalJson = this.weekend.map((item1: { [x: string]: any }) => {
        const match = this.monday.find((item2: { [x: string]: any }) =>
          item2['Building / Room'] === item1['Building / Room'] &&
          item2['Title/Meeting Name'] === item1['Title/Meeting Name']
        );

        if (match) {
          return {
            ...item1,
            latesttime: match['__EMPTY']
          };
        }

        return item1;
      });

      // ✅ Remove the last object
      this.finalMergedData = finalJson.slice(0, -1);

      // console.log('Final merged JSON:', this.finalMergedData);

      if (!this.finalMergedData || this.finalMergedData.length === 0) {
        alert('No data available to export.');
        return;
      }

      const doc = new jsPDF();

      // ✅ Add image instead of title text
      const imgData = 'data:image/jpeg;base64,';

      doc.addImage(imgData, 'PNG', 14, 10, 180, 45); // (x, y, width, height)

      const columns = [
        { header: 'Building', dataKey: 'Building / Room' },
        { header: 'Room', dataKey: 'Title/Meeting Name' },
        { header: 'Time', dataKey: 'latesttime' }
      ];

      const filteredData = this.finalMergedData.map((item: { [x: string]: any }) => {
        const fullTime = item['latesttime'] || '';
        const startTime = fullTime.split('-')[0]?.trim();
        return {
          'Building / Room': item['Building / Room'],
          'Title/Meeting Name': item['Title/Meeting Name'],
          'latesttime': startTime || ''
        };
      });

      autoTable(doc, {
        startY: 35,
        columns: columns,
        body: filteredData,
        styles: {
          fontSize: 9,
          lineWidth: 0.1,
          lineColor: [0, 0, 0]
        },
        headStyles: {
          fillColor: [128, 0, 32],
          textColor: [255, 255, 255],
          lineWidth: 0.1,
          lineColor: [0, 0, 0]
        },

        didParseCell: (data) => {
          const row = data.row.raw as {
            'Building / Room': string;
            'Title/Meeting Name': string;
            latesttime: string;
          };

          if (row.latesttime === '7:30AM') {
            data.cell.styles.fillColor = [255, 255, 0]; // yellow
          }
        }
      });
      const pdfBlob = doc.output('blob');

      const formData = new FormData();
      formData.append('file', new Blob([pdfBlob], { type: 'application/pdf' }), 'MondayReport.pdf');

      this.http.post('https://ucl-email-backend.onrender.com/send-email', formData).subscribe({
        next: (res: any) => {
          // console.log('✅ Email sent:', res.message);
          this.isLoading = false;
          alert('✅ Email sent successfully!');
        },
        error: (err) => {
          this.isLoading = false;
          console.error('❌ Email sending failed:', err);
          alert('❌ Failed to send email.');
        }
      });
      
      setTimeout(() => {
        this.isLoading = false;
        doc.save('Monday Rounds Report.pdf');
      }, 2000);
    }
  }
}
